import TypeAction from '../../constants/index';
import axios from "axios";

export const addData = async(req) =>{
    const response = await axios.get(`https://jsonplaceholder.typicode.com/todos/${req}`);
    const data = await response.json();
    return {type: TypeAction.LOGIN, payload: {"user": data, 'count': req}}
}
